};

var console = { log: function(message) { _consoleLog(message) } }
var rowId = function() { return _rowId() }

var __globalEvents = {};
var __globalSharedFunction = {};
var __globalJourney = {};

function ContextEvents() {
    this.jsEvents = new JsEvents();
    this.jsStartEvents = new JsOnStartEvents();
    this.jsCfr = new JsOnCfr();
}

function JourneyCallbackEvents() {
  this.hubId = 0;
  this.__onJourneyLog = [];
  this.__onJourneyEnd = [];
}

function JsEvents() {
    this.journeyKey = '';
    this.callbacks = {};
    this.journeyCallbacks = {};

    this.on = function(event, callback) {
        console.log(`__SYSTEM: ON: ${event} registered`)
        if (this.callbacks[event] == null) {
            this.callbacks[event] = [];
        }
        this.callbacks[event].push(callback);
    }

    this.notifyEvent = function(event, data) {
        if (this.callbacks[event] != null) {
            this.callbacks[event].forEach(function(events) {
                  this.__eventId = event
                  events(data);
            });
        }
    }

    this.onJourneyEnd = function(callback) {
        console.log('__SYSTEM: ON JOURNEY END EVENT registered: JourneyKey = ' + this.journeyKey);

        if (!(this.journeyKey in this.journeyCallbacks)) {
            this.journeyCallbacks[this.journeyKey] = new JourneyCallbackEvents();
        }
        this.journeyCallbacks[this.journeyKey].__onJourneyEnd.push(callback);
    }

    this.onJourneyLog = function(callback) {
        console.log('__SYSTEM: ON JOURNEY LOG EVENT registered: JourneyKey = ' + this.journeyKey);

        if (!(this.journeyKey in this.journeyCallbacks)) {
            this.journeyCallbacks[this.journeyKey] = new JourneyCallbackEvents();
        }
        this.journeyCallbacks[this.journeyKey].__onJourneyLog.push(callback);
    }
}

function JsOnCfr() {
  this.onCfrCallbacks = {};

  this.onCfr = function(surveyId, callback) {
    this.onCfrCallbacks[surveyId] = callback;
  }

  this.notifyOnCfr = function(surveyId, result, data) {
    if (this.onCfrCallbacks[surveyId] != null) {
      console.log('Results: ' + result.status + ' for event: ' + result.eventId);
      this.onCfrCallbacks[surveyId](result, data);
    }
  }

  this.checkCfr = function(context, eventId, surveyId, contactId, data) {
    context.checkCFRWrapper(eventId, surveyId, contactId, data);
  }
}

function JsOnStartEvents() {
  this.onStartCallbacks = [];

  this.onStart = function(callback) {
      if (this.onStartCallbacks == null) {
          this.onStartCallbacks = [];
      }

      this.onStartCallbacks.push(callback);
  }

  this.triggerOnStartEvents = function() {
      for (const events of this.onStartCallbacks) {
          events();
      }
  }
}

function __notifyEvent(key, event, data, customObj) {
    if (this.__globalEvents[key] != null) {
        console.log(`__SYSTEM: Notify Event: ${event} for key: ${key}`)
        const keys = Object.keys(customObj);
        for (i = 0; i < keys.length; i++) {
            const objKey = keys[i];
            data[objKey] = customObj[objKey];
        }

        this.__globalEvents[key].jsEvents.notifyEvent(event, data);
    }
}

function __notifyCfrEvent(key, surveyId, result, data) {
  if (this.__globalEvents[key] != null) {
    console.log('__SYSTEM: Notify on CFR: ' + surveyId + ' for key: ' + key);
    this.__globalEvents[key].jsCfr.notifyOnCfr(surveyId, result, data);
  }
}

function __triggerOnStartEvents(key) {
    if (this.__globalEvents[key] != null) {
        this.__globalEvents[key].jsStartEvents.triggerOnStartEvents();
    }
}

function __addJourneyLog(journeyKey, data) {
    if (journeyKey in this.__globalJourney) {
        var keys = Object.keys(this.__globalJourney[journeyKey].__onJourneyLog);
        var callbacks = this.__globalJourney[journeyKey].__onJourneyLog;
        for (i = 0; i < keys.length; i++) {
            callbacks[keys[i]](data);
        }
    }
}

function __notifyJourneyEnd(journeyKey, journey, postJourneyEventName) {
    if (journeyKey in this.__globalJourney) {
        var keys = Object.keys(this.__globalJourney[journeyKey].__onJourneyEnd);
        var callbacks = this.__globalJourney[journeyKey].__onJourneyEnd;
        for (i = 0; i < keys.length; i++) {
            callbacks[keys[i]](journey, postJourneyEventName);
        }
    }
}"

